function loadData(){$.ajax({url:"../Controllers/Servlet.php",type:"GET",data:{action:"data"},dataType:"json",success:function(o){if(o.error)console.log(o.msg);else{let r=$("#cardsData");r.empty(),r.html(o.html),loadScript("../Controllers/cardLogic-min.js")}},error:function(o){Swal.fire("Error","No se pudieron cargar los datos.","error")}})}function loadScript(o){let r=document.createElement("script");r.src=o,r.type="text/javascript",r.async=!1,document.body.appendChild(r)}function showData(){$.ajax({url:"../Controllers/Servlet.php",type:"GET",data:{action:"show"},dataType:"json",success:function(o){console.log("Show data de la clase"),console.log(o.msg)},error:function(o){Swal.fire("Error","No se pudieron cargar los datos.","error")}})}jQuery((function(){$.ajax({url:"../Controllers/Servlet.php",type:"GET",data:{action:"session"},dataType:"json",success:function(o){o.exits?loadData():window.location.href="/403"},error:function(o){Swal.fire("Error","Hubo un problema al cargar los datos","error")}})}));